import React, { useState, useEffect } from "react";
import { Helmet } from "react-helmet";
import { auth, db } from "../init-firebase";
import { doc, getDoc, updateDoc } from "firebase/firestore";
import { useNavigate } from "react-router-dom";
import "../styles/updatepr.css";
import Swal from "sweetalert2";

function UpdateProfile() {
  const [name, setName] = useState("");
  const [role, setRole] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  const navigate = useNavigate();

  // Fetch user data when the component is mounted
  useEffect(() => {
    const fetchUserData = async () => {
      const currentUser = auth.cu;
      if (!currentUser) {
        Swal.fire("No user is logged in.");
        return;
      }

      const userId = currentUser.uid;
      const userDocRef = doc(db, "SignuUser", userId);

      try {
        const userDocSnapshot = await getDoc(userDocRef);

        if (userDocSnapshot.exists()) {
          const userData = userDocSnapshot.data();
          setName(userData.Name || "");
          setRole(userData.Role || "");
        } else {
          Swal.fire("User data not found!");
        }
      } catch (error) {
        console.error("Error fetching user data:", error);
        Swal.fire("Failed to fetch user data.");
      }
    };

    fetchUserData();
  }, []);

  const validateInputs = () => {
    if (!name || !role) {
      Swal.fire("Please fill all required fields.");
      return false;
    }
    return true;
  };

  const Submitbtn = async (event) => {
    event.preventDefault();

    if (!validateInputs()) return;

    const currentUser = auth.currentUser; 
    console.log(currentUser)
    if (!currentUser) {
      Swal.fire("No user is logged in.");
      return;
    }

   

    setIsLoading(true);

    const userId = currentUser.uid;
    const profileData = { Name: name, Role: role };

    try {
      const userDocRef = doc(db, "SignuUser", userId);
      await updateDoc(userDocRef, profileData);
      Swal.fire("Profile updated successfully!");
      navigate("/dashboard");
    } catch (error) {
      console.error("Error updating profile:", error);
      Swal.fire(error.message || "Failed to update profile. Please try again.");
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="flex min-h-screen items-center justify-center bg-red-100 blood-background">
      <Helmet>
        <title>Update Profile</title>
      </Helmet>
      <div className="w-full max-w-md bg-white rounded-lg shadow-lg p-6 blood-shadow">
        <h2 className="text-2xl font-bold text-red-600 text-center blood-title">
          Update Profile
        </h2>
        <form onSubmit={Submitbtn}>
          <div className="mb-4">
            <label
              className="block text-gray-700 text-sm font-medium"
              htmlFor="name"
            >
              Name
            </label>
            <input
              type="text"
              id="name"
              className="w-full px-4 py-2 mt-2 border border-gray-300 rounded-lg blood-input"
              placeholder="Enter your name"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
          </div>
          <div className="mb-4">
            <label
              className="block text-gray-700 text-sm font-medium"
              htmlFor="role"
            >
              Role
            </label>
            <select
              id="role"
              className="w-full px-4 py-2 mt-2 border border-gray-300 rounded-lg blood-input"
              value={role}
              onChange={(e) => setRole(e.target.value)}
            >
              <option value="">Select Role</option>
              <option value="Donor">Donor</option>
              <option value="Receiver">Receiver</option>
            </select>
          </div>
          <div className="mb-4">
            <button
              type="submit"
              className="w-full bg-blue-500 hover:bg-blue-600 text-white py-2 px-4 rounded-lg blood-button"
              disabled={isLoading}
            >
              {isLoading ? "Updating..." : "Update Profile"}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default UpdateProfile;
